import logo from './logo.svg';
import './App.css';
import * as cal from './Calc';

function App() {
  return (
    <><h1> sum of two numbers is {`${ cal.add(10, 20)}`}
    </h1><h1> sum of two numbers is {cal.sub(10, 20)}
     </h1><h1> sum of two numbers is {cal.div(10, 20)} 
     </h1><h1> sum of two numbers is {cal.mul(10, 20)} </h1>
     </>
  );
}

export default App;
